                    <div className="space-x-4 mr-4 orderlist text-white font-serif">
                        {link.map((nav) => {
                            const { id, text, path } = nav;
                            return (

                                <Link as={`/${nav.path}`} href='/[pages]'>

                                    <a>{text}</a>
